(6187, 1970, '/stream', 'Radio tremolina', 'Podemos decir que la historia de nuestra radio empezó hace aproximadamente unos 40 años, y que ahora, tomando el testigo de ese primer proyecto, ha cristalizado en otro tiempo y en otras circunstancias.\nNosotros somos dos hermanos, Jordi y Javier. En los años 80 empezamos a participar en una radio municipal, y allí descubrimos nuestra pasión por las ondas, por el poder transmitir y conectar con los oyentes que rápidamente se fue convirtiendo en nuestra pasión.\nDespués, al cierre de la emisora y ', NULL, NULL, '320', '3', '17', 'Variada', 'http://ec4.yesstreaming.net:1530/stream', 'El Trastero con Luis López Ortiz - Lo que no me contaron en el conservatorio', NULL, NULL, '2025-05-13 20:44:05', NULL, NULL, NULL, NULL, 'audio', 'online', 0, 0, 0, 0, NULL, NULL, NULL),
